import Header from "./Header";
import Content from "./Content";
import './index.css';
import SimplePaper from './Note';
export default function App(){
return(
    <>
    <Header></Header>
    <Content />
    <div className="notes">
    < SimplePaper />
    </div>
    </>
);
};
